window.bookSummaryJSON = "<p><b>It's time for the showdown!</b></p> <p>Garralosh is on the surface, and she has bad intentions toward Anthony and his Colony. The first generation of super-intelligent ants hatches, and our \"antrepid\" protagonist has his mandibles full teaching them what it means to be a member of the family!</p> <p>It's a race against time to strengthen the Colony before disaster strikes. Big-momma croca is here, and she is hungry!</p> <p><b>Book three of the hit monster-evolution LitRPG series with nearly 30 million views on Royal Road. Grab your</b><b><i> </i></b><b>copy today!</b></p> <p><b>About this series:</b><b><i> </i></b>Jump into a rebirth story that mixes LitRPG and GameLit elements with monster evolution. Levels, stats, skills, magic, power progresion, kingdom building, party building, army building, evolution, a monster MC, gigantic enemies (compared to Ant at least), and plenty of humor fitting such a ludicrous premise.</p>"; 
